-- ----------------------------
-- Table structure for bank
-- ----------------------------
DROP TABLE IF EXISTS `bank`;
CREATE TABLE `bank` (
  `id` int(11) NOT NULL auto_increment,
  `b_name` varchar(255) default NULL,
  `b_addr` varchar(255) default NULL,
  `b_loc` varchar(255) default NULL,
  `b_pin` varchar(255) default NULL,
  `b_cno` varchar(255) default NULL,
  `b_mail` varchar(255) default NULL,
  `b_image` longblob,
  `date` varchar(255) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for bankadmin
-- ----------------------------
DROP TABLE IF EXISTS `bankadmin`;
CREATE TABLE `bankadmin` (
